import React, { Component } from 'react';
import { Card, Button } from 'react-bootstrap';

export default class KarticaVijesti extends Component {
	render() {
		return (
			<React.Fragment>
				<Card className="kartica-vijest">
					<Card.Img
						variant="top"
						src="http://auraosiguranje.com/wp-content/uploads/2016/03/Aura-Video-640x520.png"
					/>
					<Card.Body>
						<Card.Title>Obavještenje o radu šalter sala za registraciju motornih vozila</Card.Title>
						<Card.Text>{this.props.tekst}</Card.Text>
						<Button variant="primary">Go somewhere</Button>
					</Card.Body>
				</Card>
			</React.Fragment>
		);
	}
}
